import LoginBox from '../Components/LoginBox';
import  './App.css'

class App extends Component {
  state = {
    logInInfo:[
      {userName: "",
      passWord: "",
      loginSuccesful: ""}
    ]
  }




  render(){


    return(
    <html>
      <head>


        <title>Kazhuu - Login</title>
      </head>

    <body>


        <div className="login-box">
            <a href="index.html"><h1>Kazhuu Scheduling</h1></a>
            <form>
                <div className="login-cred">
                    <input type="text" className="username" placeholder="Username" required/>
                    <input type="password" className="password" placeholder="Password"required/>
                </div>
                <div>
                    <input type="submit" className="login-button" value="LogIn"/>
                </div>
            </form>
            <div className="sign-up">
                Don't Have an account? <a href="Sign-up.html">Sign Up</a>
                Forgot Password? <a href="reset-password.html">Reset Password</a>
            </div>
        </div>
    </body>
</html>
    );
  }

}
export default App;
